webpackJsonp([0xf927f8900006],{756:function(e,t){e.exports={data:{wordpressPage:{title:"You’re visiting a beauty website that’s a little bit different from all of the others.",content:'<p class="p1">How? Well, here at TBI we firmly believe that beauty comes in countless different shades, shapes and sizes and our website recognises that. We’re dedicated to providing beauty information that’s solidly-researched, well-founded, reliable, trustworthy and for absolutely everyone.</p>\n<p class="p1"><span class="s1">We’re here to provide a beauty service and at the same time build a community of like-minded folk. That is, women (and men too &#8211; we’re all friends here) who love beauty and everything related to it.</span></p>\n<p class="p1"><span class="s1">Heck. Just writing that got us excited! We hope you are too.</span></p>\n<p class="p1">\n',date:"July 01, 2016"},site:{id:"Site",siteMetadata:{title:"The Beauty Insider",subtitle:"Woo"}}},pathContext:{id:"fdaf6a66-60cf-5b8b-afc1-fad80f548336"}}}});
